estimate.mig <- function(x){
	answer <- orig.mlne.moment(x)
	return(c(paste(tail(unlist(strsplit(x, "/")),n=1)), answer))
}

results <- NULL
results.raw.for.variance <- NULL
for(i in mlne.infiles){
	answers <- estimate.mig(i)
	results <- paste(c(paste(results), paste(answers), sep=" "))
	raw.ans <- orig.mlne.moment(i)
	results.raw.for.variance <- c(results.raw.for.variance, raw.ans)
}

